import React from "react";
import ReactDom from "react-dom";

import "./index.css";


const Rapper = ({title,imageUrl,body}) => (
  <div className="card-container">
    <div className="image-container">
      <img src={imageUrl} alt=""/>
    </div>
  </div>
)
export default Rapper
